This is a subtotal of items on APRA forms LRF310.1 and LRF310.2

Report the total operating expenses classified in accordance with the requirements of these forms as:
     - policy acquisition and maintenance expenses;
     - investment management expenses;
     - acquisition expenses reported as movement in policy liability;
     - other administration expenses;
     - interest expenses; and
     - general insurance expenses.

This is the balancing item in the list in which it is being used. 

Report all operating expenses other than;

- policy acquisition and maintenance;
- investment management expenses;
- interest expense;
- general insurance operating expenses; and
- acquisition expenses reported as movement in policy liability.

This is a balancing item in the list in which it is being used.

Report the value of expenses as determined in accordance with the Life Insurance Act other than expenses in relation to

-  insurance policy expense;
- operating expenses;
- movement in net policy liabilities and adjustments thereto; and 
- changes in policy owner retained profits.

This is a balancing item in the list in which it is being used.

Report the value of claims expenses other than those specifically categorised in accordance with the requirements of APRA form LRF310 as:

- Death and Disability Claims;
- Maturities;
- Annuities;
- Surrenders and Terminations; or
- Outwards Policy Conversions.

This is the balancing item in the list in which it is being used.
Report the value of fees for management services rendered by the reporting party during the relevant period other than;
- premium related fees revenue; and - fees reported as movement in policy liabilities.

Report investment income derived from other investment assets. Investment income does not include realised and unrealised capital gains/losses.

Other investment assets are all assets classified as investment assets other than:

- cash;
- property;
- equities; and 
- debt.

Report the value of the effective movement in net policy liabilities, calculated as:
- increase/(decrease) in net policy liabilities;
- less deposits received;
- plus withdrawals of deposits;
- plus non-premium related fees for management services (which would otherwise be recognised as a reduction in policy liabilities);
- plus movements in the liability for deferred fee revenue (which are reported as part of Fees for Management Services Rendered but would otherwise result in a change in policy liabilities for Investment Contracts);
- less movements in the liability for deferred acquisition costs (which are reported as part of Operating Expenses but would otherwise result in a change in policy liabilities for Investment Contracts).

Report the value of the adjustment to the movement in net policy liabilities attributable to policy expenses recognised as a withdrawal of deposit or change in policy liability in respect of all claims other than:

- death and disability claims;
- maturities;
- annuities;
- surrenders and terminations; and
- outwards policy conversions.
